import './App.css';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<home />} />
        <Route path="/about" element={<aboutHome />} />
        <Route path="/users" element={<usersHome />}>
        <Route path="/" element={<usersHome />}/>
        </Route>
        <Route path="*" element={<div>Error Page</div>} />
      </Routes>
    </>
  );
}

export default App;
